import { Link, useRouteMatch } from "react-router-dom";
import { SidebarLink } from "../../components/AccountUtilities";
import styles from "./AccountPage.module.css";

const AdminAccountPage = () => {
  let { url } = useRouteMatch();
  return (
    <>
      <SidebarLink url={`${url}`} iconName="home" linkText="Inicio" />
      <h5>Registrar</h5>
      <SidebarLink
        url={`${url}/admin/registro/citas`}
        iconName="home"
        linkText="Inicio"
      />
      <SidebarLink url={`${url}/citas`} iconName="home" linkText="Inicio" />
      <SidebarLink url={`${url}/citas`} iconName="home" linkText="Inicio" />
      <li className={styles.navText}>
        <Link to={`${url}/citas`} className={styles.sidebarOption}>
          <box-icon name="plus-medical"></box-icon>
          <span className={styles.sidebarSpan}>Cisdfsdftas</span>
        </Link>
      </li>
      <li className={styles.navText}>
        <Link to={`${url}/pedidos`} className={styles.sidebarOption}>
          <box-icon name="cart" type="solid"></box-icon>
          <span className={styles.sidebarSpan}>Pedsdfsdfidos</span>
        </Link>
      </li>
      <li className={styles.navText}>
        <Link to={`${url}/pedidos`} className={styles.sidebarOption}>
          <box-icon type="solid" name="user"></box-icon>
          <span className={styles.sidebarSpan}>Cusdfsdfenta</span>
        </Link>
      </li>
    </>
  );
};

export default AdminAccountPage;
